import React from 'react'
import Header from './Header'
import Footer from './Footer'
import CreateNote from './CreateNote'
import Note from './Note'

const App = () => {
  const addNote = (note)=> {
    alert("I am clicked")
  };
  return (
    <>
    <Header />
    <CreateNote  passNote={addNote}/>
    <Note />
    <Footer />

    </>
  )
}

export default App;
